import './Results.css';
import Result from '../result/Result';
import React, {useEffect, useState} from "react"
import axios from 'axios';

function Results() {

  const Results = [
      {
        gymName: "Gym 1",
        gymAddress: "123 Main St",
        gymRating: "4.5"
      },
      {
        gymName: "Gym 2",
        gymAddress: "456 Main St",
        gymRating: "4.0"
      },
      {
        gymName: "Gym 3",
        gymAddress: "789 Main St",
        gymRating: "3.5"
      }
    ];

  const listOfGyms = () => {
    const [data, setData] = useState(null);

    useEffect(() => {
      // Make a GET request to your backend
      axios.get('localhost:8080/gyms')
        .then(response => {
          // Handle successful response
          setData(response.data);
        })
        .catch(error => {
          // Handle error
          console.error('Error fetching data:', error);
        });
    }, []); // Empty dependency array to run once when the component mounts

    return (
      <div>
        {/* Display fetched data */}
        {data && (
          <ul>
            {data.map(item => (
              <li key={item.id}>{item.name}</li>
            ))}
          </ul>
        )}
      </div>
    );
  };

  console.log(listOfGyms);

  return (
    <div className="results-div"> 
      <div className="results-list">
        {Results.map(result => (
          <Result 
            gymName={result.gymName}
            gymAddress={result.gymAddress} 
            gymRating={result.gymRating}
          />
          ))}
      </div>
    </div>
  );
}

export default Results;
